import React from "react";
import { useNavigate } from "react-router";

const EngineeringPage = () => {
    const navigate = useNavigate();
    return (
        <>
        <button onClick={(e) => navigate("/") } className="back-button">Back</button>
        </>
    )
}

export default EngineeringPage;
